import React,{Component} from 'react';
import{Link} from 'react-router-dom';

import '../../css/Nav.scss';

class Nav extends Component{

    render(){
        console.log(this.props.userInfo);
        return(
            <div className="nav">
                <img className="profile-img" src={this.props.userInfo.photoURL}/>
                <div src={this.props.userInfo.displayName}/>

                <Link to="/list"><div>마이페이지</div></Link>
                <Link to="/logout"><div>로그아웃</div></Link>
            </div>
        )
    }
}
export default Nav;
